INSERT INTO `wp_gf_entry_meta` VALUES (15,1,6,'4','Hello. \r\n\r\nI\'m the Founder of The Great Seed Bomb, an initiative of the Dallas Parks Foundation. I\'d like to see if we could start a public awareness campaign on bioremediation and floating pollinator/dragonfly/bird/ turtle/fish habitats for the Trinity River with several of our partners: Trinity Park Conservancy, Bonton Farms, F.A.R.M. for veterans and the City of Dallas. \r\n\r\nI\'d like to work with Green Roofs.org and get people thinking about reducing the heat island effect here with green infrastructure, bioremediation, biomimicry through pollinator gardens, living walls, green roofs and floating islands. Is there a way to interact w/ your program on a local level in Texas or is there a way to bring it here to \"Rewild the City\"? \r\n\r\nIf so, what would that process look like to start down that path? \r\n\r\nWarm regards,\r\nJilli','');
