>Error!<\\/strong> &mdash; Please enter a message.<\\/p>\\n<\\/div>\\n\\n<div class=\\\"error submission-error remote-diagnostic-content-error\\\" style=\\\"display: none;\\\">\\n\\t<p><strong>Error!<\\/strong> &mdash; Please paste in the Diagnostic Info &amp; Error Log from your <strong>remote site<\\/strong>.<\\/p>\\n<\\/div>\\n\\n<div class=\\\"error submission-error both-diagnostic-same-error\\\" style=\\\"display: none;\\\">\\n\\t<p><strong>Error!<\\/strong> &mdash; Looks like you pasted the local Diagnostic Info &amp; Error Log into the textbox for the remote info. Please get the info for your <strong>remote site<\\/strong> and paste it in, or just uncheck the second checkbox if you&#8217;d rather not include your remote site info.<\\/p>\\n<\\/div>\\n\\n<form target=\\\"_blank\\\" method=\\\"post\\\" action=\\\"https:\\/\\/api.deliciousbrains.com\\/?wc-api=delicious-brains&request=submit_support_request&licence_key=5da66c9f-7748-46c7-b260-6fd712c5604c&product=wp-migrate-db-pro\\\">\\n\\n\\t<div class=\\\"field from\\\">\\n\\t\\t<label>From:<\\/label>\\n\\t\\t<select name=\\\"email\\\">\\n\\t\\t<option value=\\\"\\\">&mdash; Select your email address &mdash;<\\/option>\\n\\t\\t<option value=\\\"wil@theinfiniteagency.com\\\">wil@theinfiniteagency.com<\\/option>\\t\\t<\\/select>\\n\\n\\t\\t<p class=\\\"note\\\">\\n\\t\\t\\tReplies will be sent to this email address. Update your name &amp; email in <a href=\\\"https:\\/\\/deliciousbrains.com\\/my-account\\/\\\">My Account<\\/a>.\\t\\t<\\/p>\\n\\t<\\/div>\\n\\n\\t<div class=\\\"field subject\\\">\\n\\t\\t<input type=\\\"text\\\" name=\\\"subject\\\" placeholder=\\\"Subject\\\">\\n\\t<\\/div>\\n\\n\\t<div class=\\\"field email-message\\\">\\n\\t\\t<textarea name=\\\"message\\\" placeholder=\\\"Message\\\"><\\/textarea>\\n\\t<\\/div>\\n\\n\\t<div class=\\\"field checkbox local-diagnostic\\\">\\n\\t\\t<label>\\n\\t\\t\\t<input type=\\\"checkbox\\\" name=\\\"local-diagnostic\\\" value=\\\"1\\\" checked>\\n\\t\\t\\tAttach <strong>this site&#8217;s<\\/strong> Diagnostic Info &amp; Error Log (below)\\t\\t<\\/label>\\n\\t<\\/div>\\n\\t\\t<div class=\\\"field checkbox remote-diagnostic\\\">\\n\\t\\t<label>\\n\\t\\t\\t<input type=\\\"checkbox\\\" name=\\\"remote-diagnostic\\\" value=\\\"1\\\" checked>\\n\\t\\t\\tAttach the <strong>remote site&#8217;s<\\/strong> Diagnostic Info &amp; Error Log\\t\\t<\\/label>\\n\\t<\\/div>\\n\\n\\t<div class=\\\"field remote-diagnostic-content\\\">\\n\\t\\t<ol>\\n\\t\\t\\t<li>Go to the Help tab of the remote site<\\/li>\\n\\t\\t\\t<li>Copy the Diagnostic Info &amp; Error Log<\\/li>\\n\\t\\t\\t<li>Paste it below<\\/li>\\n\\t\\t<\\/ol>\\n\\t\\t<textarea name=\\\"remote-diagnostic-content\\\" placeholder=\\\"Remote site&#8217;s Diagnostic Info &amp; Error Log\\\"><\\/textarea>\\n\\t<\\/div>\\n\\t\\t<div class=\\\"submit-form\\\">\\n\\t\\t<button type=\\\"submit\\\" class=\\\"button\\\">Send Email<\\/button>\\n\\t<\\/div>\\n\\n\\t<p class=\\\"note trouble\\\">\\n\\t\\tHaving trouble submitting the form? Email your support request to <a href=\\\"mailto:priority-wpmdb@deliciousbrains.com\\\">priority-wpmdb@deliciousbrains.com<\\/a> instead.\\t<\\/p>\\n\\n<\\/form>\\n\\n<\\/section>\\n\\n\\t<aside class=\\\"additional-help\\\">\\n\\t\\t<section class=\\\"docs\\\">\\n\\t\\t\\t<h1><a href=\\\"https:\\/\\/deliciousbrains.com\\/wp-migrate-db-pro\\/docs\\/\\\">Documentation<\\/a><\\/h1>\\n\\t\\t\\t<ul class=\\\"categories\\\">\\n\\t\\t\\t\\t<li><a href=\\\"https:\\/\\/deliciousbrains.com\\/wp-migrate-db-pro\\/docs\\/getting-started\\/?utm_source=MDB%2BPaid&#038;utm_campaign=support%2Bdocs&#038;utm_medium=insideplugin\\\">Getting Started<\\/a><\\/li><li><a href=\\\"https:\\/\\/deliciousbrains.com\\/wp-migrate-db-pro\\/docs\\/debugging\\/?utm_source=MDB%2BPaid&#038;utm_campaign=support%2Bdocs&#038;utm_medium=insideplugin\\\">Debugging<\\/a><\\/li><li><a href=\\\"https:\\/\\/deliciousbrains.com\\/wp-migrate-db-pro\\/docs\\/cli\\/?utm_source=MDB%2BPaid&#038;utm_campaig