o-media-files\":2351,\"wp-migrate-db-pro-cli\":3948,\"wp-migrate-db-pro-multisite-tools\":7999,\"wp-migrate-db-pro-theme-plugin-files\":36287},\"addon_list\":{\"wp-migrate-db-pro-media-files\":{\"type\":\"feature\",\"name\":\"Media Files\",\"desc\":\"Allows you to push and pull your files in the Media Library between two WordPress installs. It can compare both libraries and only migrate those missing or updated, or it can do a complete copy of one site\\u2019s library to another. <a href=\\\"https:\\/\\/deliciousbrains.com\\/wp-migrate-db-pro\\/doc\\/media-files-addon\\/?utm_campaign=addons%252Binstall&utm_source=MDB%252BPaid&utm_medium=insideplugin\\\">More Details &rarr;<\\/a>\",\"version\":\"1.4.14\",\"beta_version\":false,\"tested\":\"5.3.2\"},\"wp-migrate-db-pro-cli\":{\"type\":\"feature\",\"name\":\"CLI\",\"desc\":\"Integrates WP Migrate DB Pro with WP-CLI allowing you to run migrations from the command line: <code>wp migratedb &lt;push|pull&gt; &lt;url&gt; &lt;secret-key&gt;<\\/code> <code>[--find=&lt;strings&gt;] [--replace=&lt;strings&gt;] ...<\\/code> <a href=\\\"https:\\/\\/deliciousbrains.com\\/wp-migrate-db-pro\\/doc\\/cli-addon\\/?utm_campaign=addons%252Binstall&utm_source=MDB%252BPaid&utm_medium=insideplugin\\\">More Details &rarr;<\\/a>\",\"required\":\"1.4b1\",\"version\":\"1.3.5\",\"beta_version\":false,\"tested\":\"5.3.2\"},\"wp-migrate-db-pro-multisite-tools\":{\"type\":\"feature\",\"name\":\"Multisite Tools\",\"desc\":\"Export a subsite as an SQL file that can then be imported as a single site install. <a href=\\\"https:\\/\\/deliciousbrains.com\\/wp-migrate-db-pro\\/doc\\/multisite-tools-addon\\/?utm_campaign=addons%252Binstall&utm_source=MDB%252BPaid&utm_medium=insideplugin\\\">More Details &rarr;<\\/a>\",\"required\":\"1.5-dev\",\"version\":\"1.2.6\",\"beta_version\":false,\"tested\":\"5.3.2\"},\"wp-migrate-db-pro-theme-plugin-files\":{\"type\":\"feature\",\"name\":\"Theme & Plugin Files\",\"desc\":\"Allows you to push and pull your theme and plugin files between two WordPress installs. <a href=\\\"https:\\/\\/deliciousbrains.com\\/wp-migrate-db-pro\\/doc\\/theme-plugin-files-addon\\/?utm_campaign=addons%252Binstall&utm_source=MDB%252BPaid&utm_medium=insideplugin\\\">More Details &rarr;<\\/a>\",\"required\":\"1.8.2b1\",\"version\":\"1.0.5\",\"beta_version\":false,\"tested\":\"5.3.2\"}}}','no');
