INSERT INTO `wp_options` VALUES (1569,'_transient_acf_plugin_info_pro','a:18:{s:4:\"name\";s:26:\"Advanced Custom Fields PRO\";s:4:\"slug\";s:26:\"advanced-custom-fields-pro\";s:7:\"version\";s:5:\"5.8.7\";s:8:\"homepage\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"author\";s:64:\"<a href=\"https://www.advancedcustomfields.com\">Elliot Condon</a>\";s:12:\"contributors\";a:1:{s:12:\"elliotcondon\";a:3:{s:7:\"profile\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"avatar\";s:81:\"https://secure.gravatar.com/avatar/c296f449f92233e8d1102ff01c9bc71e?s=96&d=mm&r=g\";s:12:\"display_name\";s:22:\"Advanced Custom Fields\";}}s:8:\"requires\";s:5:\"4.7.0\";s:12:\"requires_php\";s:3:\"5.4\";s:6:\"tested\";s:5:\"5.3.0\";s:5:\"added\";s:10:\"2014-07-11\";s:12:\"last_updated\";s:10:\"2019-11-12\";s:11:\"description\";s:1349:\"<p>Use the Advanced Custom Fields plugin to take full control of your WordPress edit screens & custom field data.</p>\n\n<p><strong>Add fields on demand.</strong> Our field builder allows you to quickly and easily add fields to WP edit screens with only the click of a few buttons!</p>\n\n<p><strong>Add them anywhere.</strong> Fields can be added all over WP including posts, users, taxonomy terms, media, comments and even custom options pages!</p>\n\n<p><strong>Show them everywhere.</strong> Load and display your custom field values in any theme template file with our hassle free developer friendly functions!</p>\n\n<h4>Features</h4>\n<ul>\n<li>Simple & Intuitive</li>\n<li>Powerful Functions</li>\n<li>Over 30 Field Types</li>\n<li>Extensive Documentation</li>\n<li>Millions of Users</li>\n</ul>\n\n<h4>Links</h4>\n<ul>\n<li><a href=\"https://www.advancedcustomfields.com\">Website</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/resources/\">Documentation</a></li>\n<li><a href=\"https://support.advancedcustomfields.com\">Support</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/pro/\">ACF PRO</a></li>\n</ul>\n\n<h4>PRO</h4>\n<p>The Advanced Custom Fields plugin is also available in a professional version which includes more fields, more functionality, and more flexibility! <a href=\"https://www.advancedcustomfields.com/pro/\">Learn more</a></p>\";s:12:\"installation\";s:503:\"<p>From your WordPress dashboard</p>\n\n<ol>\n<li><strong>Visit</strong> Plugins > Add New</li>\n<li><strong>Search</strong> for \"Advanced Custom Fields\"</li>\n<li><strong>Activate</strong> Advanced Custom Fields from your Plugins page</li>\n<li><strong>Click</strong> on the new menu item \"Custom Fields\" and create your first Custom Field Group!</li>\n<li><strong>Read</strong> the documentation to <a href=\"https://www.advancedcustomfields.com/resources/getting-started-with-acf/\">get started</a></li>\n</ol>\";s:9:\"changelog\";s:2005:\"<h4>5.8.7</h4>\n<p><em>Release Date - 12 November 2019</em></p>\n\n<ul>\n<li>New - Updated admin CSS for new WordPress 5.3 styling.</li>\n<li>Fix - Fixed various issues affecting dynamic metaboxes in the block editor (requires WordPress 5.3)</li>\n<li>Fix - Fixed performance issue when checking network sites for upgrades.</li>\n<li>Fix - Fixed Select2 clones appearing after duplicating a Relationship field.</li>\n<li>Tweak - Repeater field \"Add row\" icons will now hide when maximum rows are reached.</li>\n<li>Tweak - Removed ACF Blocks keyword limit for later versions of Gutenberg.</li>\n</ul>\n\n<h4>5.8.6</h4>\n<p><em>Release Date - 24 October 2019</em></p>\n\n<ul>\n<li>New - Added more data to Google Maps field value including place_id, street_name, country and more.</li>\n<li>Fix - Fixed bug in Gallery field incorrectly displaying .pdf attachments as icons.</li>\n<li>Fix - Fixed bug in Checkbox field missing \"selected\" class after \"Toggle All\".</li>\n<li>Dev - Added compatibility for Attachments in the Post Taxonomy location rule.</li>\n<li>Dev - Added missing return statement from <code>acf_get_form()</code> function.</li>\n<li>Dev - Added \"google_map_result\" JS filter.</li>\n</ul>\n\n<h4>5.8.5</h4>\n<p><em>Release Date - 8 October 2019</em></p>\n\n<ul>\n<li>New - Added new choice \"Add\" to the User Form location rule.</li>\n<li>New - Optimized <code>acf_form()</code> logic when used in combination with <code>acf_register_form()</code>.</li>\n<li>Fix - Fixed bug causing incorrect field order after sync.</li>\n<li>Fix - Fixed bug reverting the first field type to Text in Firefox version 69.0.1.</li>\n<li>Fix - Fixed bug causing tinymce issues when changing between block modes.</li>\n<li>Fix - Fixed bug preventing block registration when category does not exist.</li>\n<li>Fix - Fixed bug preventing block registration when no icon is declared.</li>\n<li>Dev - Added RegExp compatibility for innerBlocks.</li>\n</ul>\n\n<p><a href=\"https://www.advancedcustomfields.com/changelog/\">View the full changelog</a></p>\";s:14:\"upgrade_notice\";s:0:\"\";s:5:\"icons\";a:1:{s:7:\"default\";s:63:\"https://ps.w.org/advanced-custom-fields/assets/icon-256x256.png\";}s:7:\"banners\";a:2:{s:3:\"low\";s:77:\"https://ps.w.org/advanced-custom-fields/assets/banner-772x250.jpg?rev=1729102\";s:4:\"high\";s:78:\"https://ps.w.org/advanced-custom-fields/assets/banner-1544x500.jpg?rev=1729099\";}s:8:\"versions\";a:104:{i:0;s:5:\"5.8.6\";i:1;s:5:\"5.8.5\";i:2;s:5:\"5.8.4\";i:3;s:5:\"5.8.3\";i:4;s:5:\"5.8.2\";i:5;s:5:\"5.8.1\";i:6;s:13:\"5.8.0-beta4.1\";i:7;s:11:\"5.8.0-beta4\";i:8;s:11:\"5.8.0-beta3\";i:9;s:11:\"5.8.0-beta2\";i:10;s:11:\"5.8.0-beta1\";i:11;s:9:\"5.8.0-RC2\";i:12;s:9:\"5.8.0-RC1\";i:13;s:5:\"5.8.0\";i:14;s:5:\"5.7.9\";i:15;s:5:\"5.7.8\";i:16;s:5:\"5.7.7\";i:17;s:5:\"5.7.6\";i:18;s:5:\"5.7.5\";i:19;s:5:\"5.7.4\";i:20;s:5:\"5.7.3\";i:21;s:5:\"5.7.2\";i:22;s:6:\"5.7.13\";i:23;s:6:\"5.7.12\";i:24;s:6:\"5.7.10\";i:25;s:5:\"5.7.1\";i:26;s:5:\"5.7.0\";i:27;s:5:\"5.6.9\";i:28;s:5:\"5.6.8\";i:29;s:5:\"5.6.7\";i:30;s:5:\"5.6.6\";i:31;s:5:\"5.6.5\";i:32;s:5:\"5.6.4\";i:33;s:5:\"5.6.3\";i:34;s:5:\"5.6.2\";i:35;s:6:\"5.6.10\";i:36;s:5:\"5.6.1\";i:37;s:11