\":640,\"height\":640,\"url\":\"https:\\/\\/scontent.cdninstagram.com\\/v\\/t51.2885-15\\/sh0.08\\/e35\\/s640x640\\/56580637_2271641939759746_646888016902376865_n.jpg?_nc_ht=scontent.cdninstagram.com&_nc_ohc=vwjz3OEmCAQAX8OTML6&oh=d2249689882ca687591e7f229af1e053&oe=5F02B2F2\"}},\"created_time\":\"1556025420\",\"caption\":{\"id\":\"17889751507320659\",\"text\":\"Happy Earth Day (yesterday)!!! This ancient pecan tree and small piece of barbwire were all that remained of a fence long ago constructed and then consumed by nature. I can\\u2019t help but wonder what they\\u2019d say if they could talk!?!\\n...\\nTo me this is a great illustration when thinking about Earth Day! What legacy are you leaving on our planet? How can you do better? How can \\u201cwe\\u201d do better?\\n...\\nOur challenge to everyone this week is to go outside and see how you interact with nature. Celebrate the opportunity and think about how you can leave this place just a little bit better than you found it. .\\n.\\n.\\n#earthday #earthweek #nofences \\n#wildwoodcredits #wildlife #wildlifemanagement #wildwoodenvironmental #wetland #conservation #restoration #naturalresources #swampstuff #mitigationbanking #conservationbanking #streams #wetlandmitigationcredits #mitigationcredits #abbmitigation #conservationcredits #endangeredspecies #ABB #beetlemitigation #timbermanagement #trees #ecologicaloffsetcredits #streammitigationcredits\",\"created_time\":\"1556025420\",\"from\":{\"id\":\"4475448042\",\"full_name\":\"Wildwood Credits\",\"profile_picture\":\"https:\\/\\/scontent.cdninstagram.com\\/v\\/t51.2885-19\\/s150x150\\/16124164_1611730325509221_9181589508372561920_n.jpg?_nc_ht=scontent.cdninstagram.com&_nc_ohc=S0V1S6X0MjsAX_T_IE2&oh=afb71fb8385deb74b91dc4adafb15927&oe=5EC3BB95\",\"username\":\"wildwood_credits\"}},\"user_has_liked\":false,\"likes\":{\"count\":30},\"tags\":[\"wildwoodenvironmental\",\"conservation\",\"restoration\",\"ecologicaloffsetcredits\",\"streams\",\"naturalresources\",\"ab