nd only dangerous to the rodents, frogs and lizards they eat.\\n.\\n.\\n.\\n.\\n#prairiekingsnake #wildwoodcredits #wildlife #wildlifemanagement #wildwoodenvironmental #wetland #conservation #restoration #naturalresources #swampstuff #mitigationbanking #conservationbanking #streams #wetlandmitigationcredits #mitigationcredits #abbmitigation #conservationcredits #endangeredspecies #ABB #beetlemitigation #timbermanagement #trees #ecologicaloffsetcredits #streammitigationcredits\",\"created_time\":\"1565446734\",\"from\":{\"id\":\"4475448042\",\"full_name\":\"Wildwood Credits\",\"profile_picture\":\"https:\\/\\/scontent.cdninstagram.com\\/v\\/t51.2885-19\\/s150x150\\/16124164_1611730325509221_9181589508372561920_n.jpg?_nc_ht=scontent.cdninstagram.com&_nc_ohc=S0V1S6X0MjsAX_T_IE2&oh=afb71fb8385deb74b91dc4adafb15927&oe=5EC3BB95\",\"username\":\"wildwood_credits\"}},\"user_has_liked\":false,\"likes\":{\"count\":16},\"tags\":[\"wildwoodenvironmental\",\"conservation\",\"restoration\",\"ecologicaloffsetcredits\",\"streams\",\"naturalresources\",\"abb\",\"beetlemitigation\",\"endangeredspecies\",\"streammitigationcredits\",\"wildwoodcredits\",\"abbmitigation\",\"wildlife\",\"mitigationcredits\",\"trees\",\"wetlandmitigationcredits\",\"swampstuff\",\"conservationcredits\",\"wetland\",\"prairiekingsnake\",\"wildlifemanagement\",\"timbermanagement\",\"mitigationbanking\",\"conservationbanking\"],\"filter\":\"Normal\",\"comments\":{\"count\":2},\"type\":\"image\",\"link\":\"https:\\/\\/www.instagram.com\\/p\\/B0_I7VLnTp7\\/\",\"location\":{\"latitude\":30.058900000000001,\"longitude\":-95.926400000000001,\"name\":\"Waller, Texas\",\"id\":256395179},\"attribution\":null,\"users_in_photo\":[]},{\"id\":\"2091882747719967948_4475448042\",\"user\":{\"id\":\"4475448042\",\"full_name\":\"Wildwood Credits\",\"profile_picture\":\"https:\\/\\/scontent.cdninstagram.com\\/v\\/t51.2885-19\\/s150x150\\/16124164_1611730325509221_9181589508372561920_n.jpg?_nc_ht=scontent.cdninstagram.com&_nc_ohc=S0V1S6X0MjsAX_T_IE2&oh=afb71fb8385deb74b91dc4adafb15927&oe=5EC3BB95\",\"username\":\"wildwood_credits\"},\"images\":{\"thumbnail\":{\"width\":150,\"height\":150,\"url\":\"https:\\/\\/scontent.cdninstagram.com\\/v\\/t51.2885-15\\/e35\\/s150x150\\/66322055_1906084556160118_7340496103384210110_n.jpg?_nc_ht=scontent.cdninstagram.com&_nc_ohc=UPG8nikvLqoAX-LWxqR&oh=bec31fd0c67f45380103468850ac4e37&oe=5ED2C919\"},\"low_resolution\":{\"width\":320,\"height\":320,\"url\":\"https:\\/\\/scontent.cdninstagram.com\\/v\\/t51.2885-15\\/e35\\/s320x320\\/66322055_1906084556160118_7340496103384210110_n.jpg?_nc_ht=scontent.cdninstagram.com&_nc_ohc=UPG8nikvLqoAX-LWxqR&oh=6c5dbcb5b8dde0d958f1209086483cc0&oe=5EC30261\"},\"standard_resolution\":{\"width\":640,\"height\":640,\"url\":\"https:\\/\\/scontent.cdninstagram.com\\/v\\/t51.2885-15\\/sh0.08\\/e35\\/s640x640\\/66322055_1906084556160118_7340496103384210110_n.jpg?_nc_ht=scontent.cdninstagram.com&_nc_ohc=UPG8nikvLqoAX-LWxqR&oh=79bfac71fc4deca93135da11a1020cc6&oe=5F01159C\"}},\"created_time\":\"1563591877\",\"caption\":{\"id\":\"18057052393092356\",\"text\":\"We want bison! Prior to 1800 an estimated 30 million bison roamed North America! That number dropped as low as a few thousand in the early 1900\\u2019s with our current population hanging around 500,000. How can we return these magnificent creatures responsibly back to the landscape?! #regenerativeagriculture and #hollisticmanagement seem to be a tool to make that happen! Hopefully more to come from Wildwood as we work to restore our prairies in TX and OK so that the next generation is learning about them in the flesh! #wildwoodcredits\",\"created_time\":\"1563591877\",\"from\":{\"id\":\"4475448042\",\"full_name\":\"Wildwood Credits\",\"profile_picture\":\"https:\\/\\/scontent.cdninstagram.com\\/v\\/t51.2885-19\\/s150x150\\/16124164_1611730325509221_9181589508372561920_n.jpg?_nc_ht=scontent.cdninstagram.com&_nc_ohc=S0V1S6X0MjsAX_T_IE2&oh=afb71fb8385deb74b91dc4adafb15927&oe=5EC3BB9