INSERT INTO `wp_postmeta` VALUES (243,157,'_title','field_5be06b22d8160');
INSERT INTO `wp_postmeta` VALUES (244,157,'bio','Preston is a Managing Member of Wildwood where he oversees business development and sales for the company. He has extensive experience in natural resource investing and long-term land stewardship. Preston and his team have worked with clients across the country to evolve land management practices to produce the highest ecological benefit, while delivering superior economic returns. Preston also manages the sales and marketing for all of Wildwood’s projects. He and his team have worked with a variety of industries to deliver turn-key ecological offset strategies for efficient and cost-effective permitting. Preston holds a BA from Southern Methodist University, sits on the national Board for the Ecological Restoration Business Association and serves locally on the Texas Parks and Wildlife Foundation advisory council for Tyler’s Stewards of the Wild Chapter.');
INSERT INTO `wp_postmeta` VALUES (245,157,'_bio','field_5be06b1bd815f');
