INSERT INTO `wp_postmeta` VALUES (253,159,'_title','field_5be06b22d8160');
INSERT INTO `wp_postmeta` VALUES (254,159,'bio','Cliff is a managing member of Wildwood where he and his team oversees the day-to-day operations. Cliff specializes in natural resource management, spatial science, and economics. He holds a BSF in Forest Management and a MSF in Forest Economics and Spatial Science from Stephen F. Austin State University. Cliff’s background is in commercial agriculture, timberland management, and wildland firefighting. He has obtained extensive experience in a variety of positions and ecosystems throughout the United States. Cliff is a Professional Wetland Scientist, Certified Forester and a Certified GIS Professional. He has lectured on environmental markets at the Yale School of Forestry and at Stephen F. Austin State University’s College of Forestry and Agriculture where he serves as an adjunct faculty member.');
