INSERT INTO `wp_postmeta` VALUES (262,161,'title','Partner');
INSERT INTO `wp_postmeta` VALUES (263,161,'_title','field_5be06b22d8160');
INSERT INTO `wp_postmeta` VALUES (264,161,'bio','Preston is a Managing Member of Wildwood and is the President of WLLL, LLC, a mitigation company providing capital and oversight services through the Pineywoods Mitigation Bank and the American Burying Beetle Conservation Bank. He is also a founding partner of the Burleson Wetland Mitigation Bank established in 2003. He serves as the Chairman of the Board of Trinity Mother Frances Health System, sits on the Board of Directors for Southside Bank (NASDAQ: SBSI), chairs the Advisory Council for the UT Tyler School of Engineering, is a Trustee of First Presbyterian Church of Tyler, is past President of the East Texas State Fair Association and served for nine years on the board of governors for IPAA.');
INSERT INTO `wp_postmeta` VALUES (265,161,'_bio','field_5be06b1bd815f');
