INSERT INTO `wp_postmeta` VALUES (273,163,'_title','field_5be06b22d8160');
INSERT INTO `wp_postmeta` VALUES (274,163,'bio','Larry has been directly involved in the ecosystem marketplace for over 12 years.  He is the General Partner of Burleson Wetlands Mitigation Bank founded in 2003, and is also a founding partner of WLLL, LLC, in 2009.  WLLL provides capital and oversight services for mitigation and conservation banking projects including Pineywoods Mitigation Bank, one of the largest banks in the country, and the American Burying Beetle Conservation Bank, LLC founded in 2012.  Larry is now also a Managing Member of Wildwood, where he is involved with the day to day operations of all Wildwood projects.');
