INSERT INTO `wp_postmeta` VALUES (292,167,'title','Wildlife Biologist / Ecologist');
INSERT INTO `wp_postmeta` VALUES (293,167,'_title','field_5be06b22d8160');
INSERT INTO `wp_postmeta` VALUES (294,167,'bio','Scott assists with the day-to-day management, monitoring and execution of Wildwood’s projects. He holds a BS degree in Biology from Sam Houston State University and a MS in Wildlife and Fisheries Resources from West Virginia University. He has extensive experience with threatened or endangered species and is federally licensed to trap bats in Texas, Oklahoma, Arkansas, Tennessee, North Carolina and among other states. Scott previously worked with the North Carolina Wildlife Resources Commission as the small mammal and bat biologist for western NC and more recently as a natural resource specialist for Texas Parks and Wildlife Department. Scott has extensive experience designing and implementing survey and monitoring frameworks for game and nongame species (including state and federally listed species), as well as conducting habitat assessment, management and restoration activities.');
INSERT INTO `wp_postmeta` VALUES (295,167,'_bio','field_5be06b1bd815f');
