INSERT INTO `wp_postmeta` VALUES (303,169,'_title','field_5be06b22d8160');
INSERT INTO `wp_postmeta` VALUES (304,169,'bio','Matt assists with the day to day management, monitoring, and execution of Wildwood’s projects. Previously Matt worked for the Bureau of Land Management and Montana Fish Wildlife, and Parks Department. He has worked on a number of fish and wildlife capture and tagging projects in Texas, Oklahoma, and Montana. His experience includes habitat assessments and population surveys for the Greater-Sage Grouse, and the endangered American Burying Beetle. He has extensive experience in forestry including silviculture, forest inventory, and reforestation. Matt is a native of Montana and holds a bachelor’s of science degree in Forest Wildlife Management from');
