INSERT INTO `wp_postmeta` VALUES (323,173,'_title','field_5be06b22d8160');
INSERT INTO `wp_postmeta` VALUES (324,173,'bio','Nina serves as the controller for Wildwood overseeing a diverse range of business services.<span class=\"Apple-converted-space\">  </span>She has been managing accounts for land-based projects for over 20 years.<span class=\"Apple-converted-space\">  </span>Nina also oversees all accounts payable, receivables and billing functions for the company, while serving as an administrator for information technology and payroll.<span class=\"Apple-converted-space\">  </span>Prior to her work with Wildwood, Nina served as the Director of the Hospitality Department for the PGA of America in St. Lucie, Florida. There she managed hospitality services, event planning, facility operations and even food and beverage management as it pertained to high-end event planning.');
INSERT INTO `wp_postmeta` VALUES (325,173,'_bio','field_5be06b1bd815f');
