INSERT INTO `wp_postmeta` VALUES (332,175,'_title','field_5be06b22d8160');
INSERT INTO `wp_postmeta` VALUES (333,175,'bio','Ben specializes in sourcing mitigation properties across Texas. Ben is a licensed real estate agent in Texas and has previously worked with the National Park Service, the USDA Wildlife Services as a Trapper, a Wildlife Biologist and as a Forrester across the Southeast. He holds a BS from Auburn University in Wildlife Sciences and currently resides in Tyler Texas, where he helps people invest in legacy properties across Texas.');
