INSERT INTO `wp_postmeta` VALUES (660,265,'bio','Wade assists with the day-to-day management and monitoring of Wildwood’s properties. His role spans everything from facilities maintenance to wildlife habitat improvement through planting of food plots and implementing game camera surveys. Prior to Wildwood, Wade obtained his Bachelor’s Degree from The University of Texas at Tyler in Business Administration &amp; Management and worked as a Petroleum Landman for Dixon Services, Inc., for over 10 years. This experience allows him to assist with title opinions, oil &amp; gas research, and mapping of this infrastructure in the targeting and acquisition of new Wildwood projects.');
