INSERT INTO `wp_posts` VALUES (61,2,'2016-12-29 22:00:40','2016-12-29 22:00:40','<div class=\"row\">\r\n<h1>Welcome to Bowtie</h1>\r\nYou may login with the usual developer username and password.\r\n\r\n<h3>Installed Plugins</h3>\r\n<ul>\r\n 	<li>Advanced Custom Fields Pro</li>\r\n 	<li>Custom Post Type UI</li>\r\n 	<li>Google Analytics</li>\r\n 	<li>Gravity Forms</li>\r\n 	<li>WP Migrate DB Pro</li>\r\n</ul>\r\n<h3>Installed Theme</h3>\r\n<ul>\r\n 	<li>Bowtie 1.1 (<a href=\"https://github.com/theinfiniteagency/Bowtie\" target=\"_blank\">Github</a>)\r\n<ul>\r\n 	<li>Foundation 6.3.0 (<a href=\"http://foundation.zurb.com/sites/docs/\" target=\"_blank\">Documentation</a>)</li>\r\n 	<li>Gulp</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h3>Settings and Features</h3>\r\n<ul>\r\n 	<li>This page is set as homepage.</li>\r\n 	<li>\"Discourage search engines from indexing this site\" is <em>unchecked</em>.</li>\r\n</ul>\r\n<h4>Shortcodes</h4>\r\n<ul>\r\n 	<li><code>&lsqb;logo type=\"primary\"&rsqb;</code> will embed /wp-content/themes/bowtie/assets/img/logo-primary.svg</li>\r\n 	<li><code>&lsqb;social_media&rsqb;</code> will embed a div.social with icons defined in Options.</li>\r\n 	<li><code>&lsqb;contact id=\"address/email/phone\"&rsqb;</code> will embed contact information defined in Options.</li>\r\n</ul>\r\n</div>','Home','','inherit','closed','closed','','2-revision-v1','','','2016-12-29 22:00:40','2016-12-29 22:00:40','',2,'http://brewedinhtown.dev/2016/12/2-revision-v1/',0,'revision','',0);
