INSERT INTO `wp_posts` VALUES (178,2,'2018-11-05 16:49:46','2018-11-05 16:49:46','<h2>CONTACT US</h2>\r\n<p class=\"accent\">LET OUR RESOURCES BE YOURS!</p>\r\nWe are always looking for likeminded partners who believe in leaving things better than they found them. Do you need a permit for an upcoming project? Are you interested in creating environmental credits with Wildwood? Or maybe you just want to come up with a management plan for your property? Its Wildwood’s goal to help provide answers in a simple, straight forward way, so let’s get the conversation started!','Contact Us','','publish','closed','closed','','contact-us','','','2018-12-18 22:07:53','2018-12-18 22:07:53','',0,'http://wildwood2018.wpengine.com/?page_id=178',0,'page','',0);
INSERT INTO `wp_posts` VALUES (179,2,'2018-11-05 16:49:35','2018-11-05 16:49:35','','Contact Us','','inherit','closed','closed','','178-revision-v1','','','2018-11-05 16:49:35','2018-11-05 16:49:35','',178,'http://wildwood2018.wpengine.com/2018/11/178-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (181,2,'2018-11-05 16:49:46','2018-11-05 16:49:46','<h2>CONTACT US</h2>\r\n<p class=\"accent\">LET OUR RESOURCES BE YOURS!</p>\r\nWe are always looking for likeminded partners who believe in leaving things better than they found them. Do you need a permit for an upcoming project? Are you interested in creating environmental credits with Wildwood? Or maybe you just want to come up with a management plane for your property? Its Wildwood’s goal to help provide answers in a simple, straight forward way, so let’s get the conversation started!','Contact Us','','inherit','closed','closed','','178-revision-v1','','','2018-11-05 16:49:46','2018-11-05 16:49:46','',178,'http://wildwood2018.wpengine.com/2018/11/178-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (182,2,'2018-11-05 16:52:31','2018-11-05 16:52:31','<h2>THE WILDWOOD DIFFERENCE</h2>\r\nWe separate ourselves by being ourselves and that makes all the difference! <a href=\"#our-team\">Our Team</a> has extensive experience in mitigation/conservation banking, permittee-responsible project generation, geospatial opportunity mapping, and land stewardship. Combining these talents with a strategic approach to mitigation, a client first mentality for sales, and personal pride in restoration is what makes Wildwood unique.','About','','publish','closed','closed','','about','','','2018-12-21 16:24:00','2018-12-21 16:24:00','',0,'http://wildwood2018.wpengine.com/?page_id=182',0,'page','',0);
INSERT INTO `wp_posts` VALUES (184,2,'2018-11-05 16:52:31','2018-11-05 16:52:31','<h2>WHAT IS THE WILDWOOD DIFFERENCE?</h2>\r\nWe separate ourselves by being ourselves and that makes all the difference! Our Team {BUTTON} has extensive experience in mitigation/conservation banking, permittee-responsible project generation, geospatial opportunity mapping, and land stewardship. Combining these talents with a strategic approach to mitigation, a client first mentality for sales, and personal pride in restoration is what makes Wildwood unique.','About','','inherit','closed','closed','','182-revision-v1','','','2018-11-05 16:52:31','2018-11-05 16:52:31','',182,'http://wildwood2018.wpengine.com/2018/11/182-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (185,2,'2018-11-05 16:54:46','2018-11-05 16:54:46','Purchasing ecological offsets, or mitigation credits, is a quick and easy way to demonstrate Clean Water Act compliance for your permit (Endangered Species Act too!). Mitigation banking is actually the preferred compensatory offset by the U.S. Army Corps of Engineers, and a great strategy for many U.S. Fish and Wildlife Service districts across the country. Equally important, the purchase of mitigation bank credits transfers environmental liabilities from your project to one of Wildwood’s established mitigation banks, allowing you to focus on core business, while we deal with the weeds.','Buy Credits','','publish','closed','closed','','buy-credits','','','2018-12-17 16:11:50','2018-12-17 16:11:50','',0,'http://wildwood2018.wpengine.com/?page_id=185',0,'page','',0);
INSERT INTO `wp_posts` VALUES (187,2,'2018-11-05 16:54:46','2018-11-05 16:54:46','Purchasing ecological offsets, or mitigation credits, is a quick and easy way to demonstrate Clean Water Act compliance for your permit (Endangered Species Act too!). Mitigation banking is actually the preferred compensatory offset by the U.S. Army Corps of Engineers, and a great strategy for many U.S. Fish and Wildlife Service districts across the country. Equally important, the purchase of mitigation bank credits transfers environmental liabilities from your project to one of Wildwood’s established mitigation banks, allowing you to focus on core business, while we deal with the weeds.','Buy Credits','','inherit','closed','closed','','185-revision-v1','','','2018-11-05 16:54:46','2018-11-05 16:54:46','',185,'http://wildwood2018.wpengine.com/2018/11/185-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (188,2,'2018-11-05 16:55:01','2018-11-05 16:55:01','','buy-credits','','inherit','open','closed','','buy-credits-2','','','2018-11-05 16:55:01','2018-11-05 16:55:01','',185,'http://wildwood2018.wpengine.com/wp-content/uploads/2018/11/buy-credits.jpg',0,'attachment','image/jpeg',0);
INSERT INTO `wp_posts` VALUES (189,2,'2018-11-05 16:56:34','2018-11-05 16:56:34','Where do credits come from? This can be a tricky question, but we do our best to simplify the answer. Wildwood (and others) develop mitigation credits through the restoration of degraded ecosystems on land we own, or through joint ventures with property owners. The size of these projects, amount of restoration and subsequent prescriptions vary, but at the end of the day our credits come from positive changes to our shared natural resources.','Create Credits','','publish','closed','closed','','create-credits','','','2018-11-05 16:56:34','2018-11-05 16:56:34','',0,'http://wildwood2018.wpengine.com/?page_id=189',0,'page','',0);
