INSERT INTO `wp_posts` VALUES (192,2,'2018-11-05 16:56:34','2018-11-05 16:56:34','Where do credits come from? This can be a tricky question, but we do our best to simplify the answer. Wildwood (and others) develop mitigation credits through the restoration of degraded ecosystems on land we own, or through joint ventures with property owners. The size of these projects, amount of restoration and subsequent prescriptions vary, but at the end of the day our credits come from positive changes to our shared natural resources.','Create Credits','','inherit','closed','closed','','189-revision-v1','','','2018-11-05 16:56:34','2018-11-05 16:56:34','',189,'http://wildwood2018.wpengine.com/2018/11/189-revision-v1/',0,'revision','',0);
