INSERT INTO `wp_posts` VALUES (229,2,'2018-11-05 22:52:59','2018-11-05 22:52:59','Our team specializes in delivering value to our partners through simplifying the mitigation process. Do you need wetlands, stream, or endangered species credits for a pending project? Do you just want to learn more about mitigation and how you can create your own? It can be a jungle out there, so let Wildwood be your guide!','Home','','inherit','closed','closed','','2-revision-v1','','','2018-11-05 22:52:59','2018-11-05 22:52:59','',2,'http://wildwood2018.wpengine.com/2018/11/2-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (230,2,'2018-11-05 23:06:41','2018-11-05 23:06:41','<p class=\"p1\"><span class=\"s1\">By: Preston W. Smith, Managing Member</span></p>\r\n<p class=\"p1\"><span class=\"s1\">We are often asked, “what is Wildwood Environmental Credit Company?” Well, in an effort to keep things simple we put it in our name. Wildwood for short, is an environmental credit company. We have assembled a team of natural resource experts who specialize in the development, management and stewardship of mitigation projects.</span></p>\r\n<p class=\"p1\"><span class=\"s1\"><b>So, what is mitigation?</b></span></p>\r\n<p class=\"p1\"><span class=\"s1\">“Mitigation” like almost all words has its origins in Latin, and means to “alleviate”. Wildwood provides environmental credit through the process of mitigation.<span class=\"Apple-converted-space\">  </span>We do this by taking land and improving the natural resources to generate environmental credit, which we then can provide to offset adverse impacts for business of all sizes. </span></p>\r\n<p class=\"p1\"><span class=\"s1\"><b>Why mitigate? </b></span></p>\r\n<p class=\"p1\"><span class=\"s1\">Besides the obvious big picture concerns with trashing our environment, the US Government created a federal regulation in the 70’s to protect our aquatic resources called the Clean Water Act. This law requires developers to offset any adverse impacts to wetlands, or streams, that might be affected by the construction of their project. Mitigating through a company like Wildwood allows developers to expedite the permitting process, fully transfer their environmental liability and remain focused on their core business, while we handle the ecological restoration. <b>How do you create mitigation credits?</b></span></p>\r\n<p class=\"p1\"><span class=\"s1\">The process starts when we buy land and/or partner with the landowners to restore high value ecosystems. Through a thorough evaluation process, we determine the best way to restore previously degraded natural resources, ultimately enhancing the functions of these ecosystems (i.e. wetlands, streams, endangered species habitat). When the US Army Corps of Engineers, or the US Fish &amp; Wildlife Services, who oversee the issuance of permits, approve these projects we create environmental credit that is transferable to other companies.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Wildwood has developed a network of mitigation banks, and like real banks we provide environmental credits to developers in need of offsets for their project’s debts.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">If Wildwood doesn’t have a bank that services your project, you should ask us about our track record delivering alternative turn-key mitigation strategies like permittee-responsible projects.</span></p>\r\n<p class=\"p1\"><span class=\"s1\"><b>So, who is Wildwood?</b></span></p>\r\n<p class=\"p1\"><span class=\"s1\">We are the creators of environmental credit, stewards of the swamps, sponsors of endangered species, and provider of permits. In more technical terms, Wildwood is a mitigation specialist creating turn-key strategies through our banks and permittee-responsible projects to provide permits for our clients across all industries. We’re always interested in new projects, providing quotes, or answering questions, so if you want to know us better just reach out!</span></p>\r\n<p class=\"p2\"><a href=\"http://wildwood.local/contact-us/\"><span class=\"s1\">Contact us!</span></a></p>','Who is Wildwood Environmental Credit Company?','','publish','open','open','','who-is-wildwood-environmental-credit-company','','','2018-11-05 23:06:51','2018-11-05 23:06:51','',0,'http://wildwood2018.wpengine.com/?p=230',0,'post','',0);
INSERT INTO `wp_posts` VALUES (231,2,'2018-11-05 23:06:41','2018-11-05 23:06:41','<p class=\"p1\"><span class=\"s1\">By: Preston W. Smith, Managing Member</span></p>\r\n<p class=\"p1\"><span class=\"s1\">We are often asked, “what is Wildwood Environmental Credit Company?” Well, in an effort to keep things simple we put it in our name. Wildwood for short, is an environmental credit company. We have assembled a team of natural resource experts who specialize in the development, management and stewardship of mitigation projects.</span></p>\r\n<p class=\"p1\"><span class=\"s1\"><b>So, what is mitigation?</b></span></p>\r\n<p class=\"p1\"><span class=\"s1\">“Mitigation” like almost all words has its origins in Latin, and means to “alleviate”. Wildwood provides environmental credit through the process of mitigation.<span class=\"Apple-converted-space\">  </span>We do this by taking land and improving the natural resources to generate environmental credit, which we then can provide to offset adverse impacts for business of all sizes. </span></p>\r\n<p class=\"p1\"><span class=\"s1\"><b>Why mitigate? </b></span></p>\r\n<p class=\"p1\"><span class=\"s1\">Besides the obvious big picture concerns with trashing our environment, the US Government created a federal regulation in the 70’s to protect our aquatic resources called the Clean Water Act. This law requires developers to offset any adverse impacts to wetlands, or streams, that might be affected by the construction of their project. Mitigating through a company like Wildwood allows developers to expedite the permitting process, fully transfer their environmental liability and remain focused on their core business, while we handle the ecological restoration. <b>How do you create mitigation credits?</b></span></p>\r\n<p class=\"p1\"><span class=\"s1\">The process starts when we buy land and/or partner with the landowners to restore high value ecosystems. Through a thorough evaluation process, we determine the best way to restore previously degraded natural resources, ultimately enhancing the functions of these ecosystems (i.e. wetlands, streams, endangered species habitat). When the US Army Corps of Engineers, or the US Fish &amp; Wildlife Services, who oversee the issuance of permits, approve these projects we create environmental credit that is transferable to other companies.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Wildwood has developed a network of mitigation banks, and like real banks we provide environmental credits to developers in need of offsets for their project’s debts.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">If Wildwood doesn’t have a bank that services your project, you should ask us about our track record delivering alternative turn-key mitigation strategies like permittee-responsible projects.</span></p>\r\n<p class=\"p1\"><span class=\"s1\"><b>So, who is Wildwood?</b></span></p>\r\n<p class=\"p1\"><span class=\"s1\">We are the creators of environmental credit, stewards of the swamps, sponsors of endangered species, and provider of permits. In more technical terms, Wildwood is a mitigation specialist creating turn-key strategies through our banks and permittee-responsible projects to provide permits for our clients across all industries. We’re always interested in new projects, providing quotes, or answering questions, so if you want to know us better just reach out!</span></p>\r\n<p class=\"p2\"><a href=\"http://wildwood.local/contact-us/\"><span class=\"s1\">Contact us!</span></a></p>','Who is Wildwood Environmental Credit Company?','','inherit','closed','closed','','230-revision-v1','','','2018-11-05 23:06:41','2018-11-05 23:06:41','',230,'http://wildwood2018.wpengine.com/2018/11/230-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (232,2,'2018-11-05 23:07:10','2018-11-05 23:07:10','Wildwood completes the biggest feat in Texas mitigation history! When tasked with the challenge to take on Pineywoods Mitigation Bank, what did Wildwood do? We put our “big boy” pants on and went to work! A few years later… here we are.\r\n\r\nPineywoods Mitigation Bank is celebrating its tenth anniversary and with Wildwood at the helm the completion of its site development plan. What’s the big deal? Pineywoods is one of the largest mitigation banks in the country at over 19,000 acres, so when you reach the finish line on a project this big it comes with some pride.  Looking back at the last ten years of Pineywoods, what do we see?\r\n<ul>\r\n 	<li>Conversion of commercial pine planation back to bottomland hardwood</li>\r\n 	<li>Planted over 500,000 trees</li>\r\n 	<li>Restoration of over 15,000 acres of wetlands all at one site</li>\r\n 	<li>Riparian buffer work to help stabilize over 50 miles (that’s 264,000 linear feet!) of the Neches river and surrounding tributaries</li>\r\n 	<li>Sponsorship of multiple master’s candidates at Stephen F. Austin advancing the understanding of how to treat invasive species</li>\r\n 	<li>Providing mitigation for hundreds of public and private development projects</li>\r\n 	<li>Zero compliance violations</li>\r\n</ul>\r\nBefore you hand us the keys to the city, Wildwood didn’t do this alone. Pineywoods provides a significant amount of public benefit from cleaner water to floodwater retention and this couldn’t have been accomplished without public partnerships. The Fort Worth and Galveston USACE Districts helped shape what Pineywoods has become and will be an essential partner in its future success.\r\n\r\nWhat’s after the finish line? Mitigation banks and the protections they put on the land are forever!  So with restricted future uses, the money to manage properties like Pineywoods have to come from credit sales.  In exchange for all the work Wildwood has administered on site, Pineywoods now has thousands of emergent (PEM) and forest (PFO) credits to sell for future adverse impacts, and with an inventory like that, we plan to provide below market pricing making us the best bang for the buck in the primary and secondary service areas.\r\n\r\nFor more about Wildwood, our team, and our projects visit our website at wildwoodcredits.com.','Project Highlight: Pineywoods Mitigation Bank Then and Now','','publish','open','open','','project-highlight-pineywoods-mitigation-bank-then-and-now','','','2018-11-05 23:07:10','2018-11-05 23:07:10','',0,'http://wildwood2018.wpengine.com/?p=232',0,'post','',0);
INSERT INTO `wp_posts` VALUES (233,2,'2018-11-05 23:07:10','2018-11-05 23:07:10','Wildwood completes the biggest feat in Texas mitigation history! When tasked with the challenge to take on Pineywoods Mitigation Bank, what did Wildwood do? We put our “big boy” pants on and went to work! A few years later… here we are.\r\n\r\nPineywoods Mitigation Bank is celebrating its tenth anniversary and with Wildwood at the helm the completion of its site development plan. What’s the big deal? Pineywoods is one of the largest mitigation banks in the country at over 19,000 acres, so when you reach the finish line on a project this big it comes with some pride.  Looking back at the last ten years of Pineywoods, what do we see?\r\n<ul>\r\n 	<li>Conversion of commercial pine planation back to bottomland hardwood</li>\r\n 	<li>Planted over 500,000 trees</li>\r\n 	<li>Restoration of over 15,000 acres of wetlands all at one site</li>\r\n 	<li>Riparian buffer work to help stabilize over 50 miles (that’s 264,000 linear feet!) of the Neches river and surrounding tributaries</li>\r\n 	<li>Sponsorship of multiple master’s candidates at Stephen F. Austin advancing the understanding of how to treat invasive species</li>\r\n 	<li>Providing mitigation for hundreds of public and private development projects</li>\r\n 	<li>Zero compliance violations</li>\r\n</ul>\r\nBefore you hand us the keys to the city, Wildwood didn’t do this alone. Pineywoods provides a significant amount of public benefit from cleaner water to floodwater retention and this couldn’t have been accomplished without public partnerships. The Fort Worth and Galveston USACE Districts helped shape what Pineywoods has become and will be an essential partner in its future success.\r\n\r\nWhat’s after the finish line? Mitigation banks and the protections they put on the land are forever!  So with restricted future uses, the money to manage properties like Pineywoods have to come from credit sales.  In exchange for all the work Wildwood has administered on site, Pineywoods now has thousands of emergent (PEM) and forest (PFO) credits to sell for future adverse impacts, and with an inventory like that, we plan to provide below market pricing making us the best bang for the buck in the primary and secondary service areas.\r\n\r\nFor more about Wildwood, our team, and our projects visit our website at wildwoodcredits.com.','Project Highlight: Pineywoods Mitigation Bank Then and Now','','inherit','closed','closed','','232-revision-v1','','','2018-11-05 23:07:10','2018-11-05 23:07:10','',232,'http://wildwood2018.wpengine.com/2018/11/232-revision-v1/',0,'revision','',0);
