INSERT INTO `wp_posts` VALUES (287,2,'2019-02-13 17:13:10','2019-02-13 17:13:10','Do you know the New Mexico state motto? To save you from Googling, the motto is “It grows as it goes.” When hearing this for the first time I had to suppress a chuckle (sorry New Mexicans), but upon learning where it came from it left an impression on me. This motto references the dynamic progress of the state’s past, present, future and ultimately its legacy.\r\n\r\nThe tendency of business in our “age of acceleration”, borrowing from Friedman, seems to only be about the now, A-Z rounds of funding, and customer retention sans profitability. Wildwood on the other hand is focused on forever. Our company’s roots were planted by our partners over 20 years ago and today we continue to grow a successful portfolio of projects organically. Counterintuitive as “organic” might be in today’s bigger, faster culture, we’re okay with it because we can be intentional about the legacy we’re leaving.\r\n\r\nWe separate ourselves by being ourselves and at Wildwood that means a strategic approach to restoration, taking a client first approach, and intensely focusing on our legacy. Isn’t a legacy something that writes itself? Yes, but when you work in the field of perpetuity it’s extremely important to start in the right direction. Perpetuity sounds like a bold statement for a relatively young company, but it’s a requirement of our work and each Wildwood restoration project ends up with a conservation easement protecting it forever. Our mitigation banks, permittee-responsible mitigation sites, and conservation banks are all protected in perpetuity by conservation easements, which means from day one we have to think about legacy.\r\n\r\nWhy legacy? Why organic growth? Outside of the cliched answers for a company that specializes in natural resources, because organic growth only comes on the back of proven success. Each of us at Wildwood believe the work we do to marry economics with ecology truly makes a difference and will dynamically change the landscape. Steadfast, organic growth allows us to stay focused on writing tomorrow’s legacy today. Obviously, we are proud of our projects and believe in marketing to showcase our work (ie. this newsletters), but at the end of the day Wildwood enjoys to grow as we go.','It Grows as it Goes','','publish','open','open','','it-grows-as-it-goes','','','2019-02-13 17:13:10','2019-02-13 17:13:10','',0,'http://wildwood.local/?p=287',0,'post','',0);
INSERT INTO `wp_posts` VALUES (289,2,'2019-03-01 22:59:36','2019-03-01 22:59:36','Our team specializes in delivering value to our partners through simplifying the mitigation process. Do you need wetlands, stream, or endangered species credits for a pending project? Do you just want to learn more about mitigation and how you can create your own? It can be a jungle out there, so let Wildwood be your guide!','Home','','inherit','closed','closed','','2-autosave-v1','','','2019-03-01 22:59:36','2019-03-01 22:59:36','',2,'http://wildwood.local/2-autosave-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (292,2,'2019-12-27 16:54:40','2019-12-27 16:54:40','<p class=\"p1\"><span class=\"s1\">Considering the frequency of one’s blog is essential for strong Google rankings, I’d say its probably time Wildwood add our second post for the year.<span class=\"Apple-converted-space\">  </span>I know our loyal readers (thanks Nana) can’t wait to hear what’s new in the world of environmental credits.<span class=\"Apple-converted-space\">  </span>Fortunately, we have some pretty exciting news to close out 2019! </span></p>\r\n<p class=\"p1\"><span class=\"s1\">Wildwood is expanding our services and geographic presence under a new partnership with <a href=\"https://www.troutheadwaters.com/about/\"><span class=\"s2\">Trout Headwaters, Inc. (THI)</span></a> out of Livingston Montana.<span class=\"Apple-converted-space\">  </span>Best new office location ever? Yes, but not the only reason we’ve linked up with THI.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">THI has been an industry leader in sustainable approaches to stream, wetland and habitat restoration, renewal, and repair since their founding in 1996.<span class=\"Apple-converted-space\">  </span>The company’s professional team of biologists, ecologists, hydrologists, engineers, and installation specialists have taken a multidisciplinary approach to the successful assessment, design, installation, management and maintenance of more than 500 projects across the United States. </span></p>\r\n<p class=\"p1\"><span class=\"s1\">Why partner now? Wildwood states on our website, “<a href=\"https://wildwood.local/#contact\"><span class=\"s2\">We are always looking for likeminded partners who believe in leaving things better than they found them.</span></a>”, and that’s absolutely true!<span class=\"Apple-converted-space\">  </span>Located across the country and working in distinctly different parts of it, Wildwood and THI only crossed paths occasionally, but when we did it was easy to spot a reflection we recognized. Central to both our organizations is a passion for restoration, a strong client first mentality, organic growth and the desire to write a legacy of positive change on our shared natural resources!<span class=\"Apple-converted-space\">  </span>So why partner now?<span class=\"Apple-converted-space\">  </span>They say experience is the greatest teacher and with an almost quarter century of lessons it won’t be hard to learn from THI.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Wildwood and THI will continue to maintain our own identities for the foreseeable future, but the newly formed partnership has already begun levering our complimentary skillsets to provide tangible value to our clients.<span class=\"Apple-converted-space\">  </span>This new team could not be more excited at the opportunities for economic growth we see in the world of restoration!</span></p>','Right Time Right Place','','publish','open','open','','right-time-right-place','','','2019-12-27 16:54:40','2019-12-27 16:54:40','',0,'http://wildwood.local/?p=292',0,'post','',0);
